import React from 'react';
import './HomePortfolio.css';
import Fundo from '../../../assets/fundo.jpg';
import { FaLaptopCode, FaMobileAlt, FaDesktop } from 'react-icons/fa';

function HomePortfolio() {
    return (
        <section className="homePortfolio">
            <img src={Fundo} alt="Fundo" className="fotoFundo" />
            <div className="homePortfolio-content">
                <h1>Olá, sou Monise Da Silva!</h1>
                <p>
                    <FaLaptopCode className="icon"/> <FaMobileAlt className="icon"/> <FaDesktop
                    className="icon"/><br/><br/>
                    Desenvolvedora Back-End com experiência em Java, Node.js, React, e APIs REST. <br/><br/>
                    Apaixonada por tecnologia e por criar soluções que impulsionam negócios e otimizam processos.
                </p>

                <p>
                    Formada em Tecnologia da Informação pela Univesp, sempre busco entregar sistemas modernos e funcionais. Estou pronta para contribuir com projetos desafiadores e colaborar no crescimento de sua equipe.
                </p>

                <a href="#contatoPortfolio" className="cta-button">Entre em Contato</a>
            </div>
        </section>
    );
}

export default HomePortfolio;
